import React, { useState } from "react";
import Navbar from "../../components/Navbar";
import Footer from "../../components/Footer";
import FormFields from "./Form_Fields";

const CreateCustomer = () => {
  const [writingDirection, setWritingDirection] = useState("ltr");
  const [message, setMessage] = useState("Hello World");
  return (
    <>
      <Navbar />
      <main>
        <section class="p-[4rem] grid justify-center items-center" dir={writingDirection}>
          <div class="row">
            <a href="/customers">
              <i class="fas fa-arrow-left"></i>Customers
            </a>
          </div>
          <h1 class="title">New Customer</h1>
          <p class="message">{message}</p>
          <form action="/customers" method="POST" className="flex flex-col">
            <FormFields />
          </form>
        </section>
      </main>
      <Footer />
    </>
  );
};

export default CreateCustomer;
